const Header = () => {
  const imgUrl =
    "https://assets.stickpng.com/images/612ce4761b9679000402af1c.png";
  return (
    <h1 style={{ fontSize: "48px" }}>
      Who's that Pokemon?
      <span style={{}}>
        <img src={imgUrl} style={{ width: "100%", height: "48px" }} />
      </span>
    </h1>
  );
};

export default Header;
